import './Products.css';
// import Card from '../Card/Card';

const productList = [
  {"name":"Комплект с аметистовыми друзами",
    "price":"1900",
    "image":"51-3.png",
  },
  {"name":"Дорогой товар",
    "price":"13900",
    "image":"59-2.png",
  },
  {"name":"Товар с неадекватно длинным названием, чтобы проверить контейнер",
    "price":"9700",
    "image":"94.png",
  },
  {"name":"Комплект с аметистовыми друзами",
    "price":"1900",
    "image":"51-3.png",
  },
  {"name":"Дорогой товар",
    "price":"13900",
    "image":"59-2.png",
  },
  {"name":"Товар с неадекватно длинным названием, чтобы проверить контейнер",
    "price":"9700",
    "image":"94.png",
  },
]

export default function Products() {
  return (
    <section className='products'>
      <ul className='products__list'>
        {productList.map((product) => (
          <Card
            name={product.name}
            image={product.image}
            price={product.price}
          ></Card>
        ))}
      </ul>
    </section>
  )
}
